import React from 'react'

const Card = (props) => {
    return (
        <div>
            <div className="card mt-3 " style={{ width: '18rem', "maxHeight": '360px' }}>
                <img src="https://images.pexels.com/photos/376464/pexels-photo-376464.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1" className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 className="card-title" style={{ color: "black" }}>{props.foodname}</h5>
                    <p className="card-text" style={{ color: "black" }}>Some Important text.</p>
                    <div className='container w-100'>
                        <select className='m-2 h-100  bg-success rounded' style={{ color: "white" }}>
                            {Array.from(Array(6), (e, i) => {
                                return (
                                    <option key={i + 1} value={i + 1}>{i + 1}</option>
                                )
                            })}
                        </select>

                        <select className='m-2 h-100  bg-success rounded' style={{ color: "white" }}>
                            <option value="half">Half</option>
                            <option value="full">Full</option>
                        </select>
                        <div className='d-inline h-100 fs-5' style={{ color: "black" }}>Total Price</div>

                    </div>

                </div>
            </div>
        </div>
    )
}

export default Card
